for anyone looking for an anti 5G argument:

most people will probably be totally fine with 5G but not everyone. a friend of mine for example for some reason she can sorta sense certain types of radio waves. she had to move house because her house was near a cellphone tower and at first this wasn't a problem but over the years when people started to use their phones and internet more, more and more signals were transmitted and she started to get headaches from it and it got so bad that she had to move. but also in other situations like we were at a bbq and at one point my sister took out her cellphone to check something and this person felt it like a slap in the face, i can stil see it happen. with 5G she cant go anywhere to escape the signals and she'll have headaches everywhere she goes. this cant be healthy. 

now you're probably not going to believe me (i wouldnt) but some people actually do have special abilitys/senses that other people dont.
